scriptlet.script:
try{
	var strArray = rowData.split("");
	var seqCode = strArray.slice(0,3).join('').trim();
	var st = strArray.slice(4,5).join('').trim();
	var deptCode = strArray.slice(8,10).join('').trim();
	var reasCode = strArray.slice(15,17).join('').trim();
	var noteDate = strArray.slice(20,30).join('').trim();
	var leadTime = strArray.slice(31,34).join('').trim();
	var amount = strArray.slice(35,51).join('').trim().replace(/,/g, '');
	var remarks = strArray.slice(52,78).join('').trim();

	var line = "<Entry SEQ=\""+seqCode+"\" ST=\""+st+"\" DEPT_CODE=\""+deptCode+"\" REAS_CODE=\""+reasCode+"\" NOTE_DATE=\""+noteDate+"\" LEAD_TIME=\""+leadTime+"\" AMOUNT=\""+amount+"\" REMARKS=\""+remarks+"\"/>"

	scriptletContext.put("xmlRow", line);
	response = "success";
} catch(err) {
	scriptletContext.put("errorMessage",err.message);	
	response = "failure";
}
scriptletResponse = response
